import React from "react"
import JapanImg from "../startseite_assets/japan.png"

import Box from "./Box"
import Footer from "../global_components/Footer"

import boxData from "../startseite_data/boxData"

function MainContentStartseite(){

    const myBoxes = boxData.map(function(box){
        return <Box key={box.id} title={box.title} subtitle={box.subtitle}/>
    })

    return(
        <div className="container_main banner_startseite">
            <div className="body_box_container">
                {myBoxes}
            </div>
            <Footer />
        </div>
    )
}

export default MainContentStartseite
